import styled from 'styled-components';

const IndexBlock = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  max-height: 100%;
`;

const Index = () => {
  return (
    <IndexBlock>
      <h1>THis is Index Page aa</h1>
    </IndexBlock>
  );
};

export default Index;
